import image7 from "../images/catalogue/hmgoepprod6.jpeg"
import image8 from "../images/catalogue/hmgoepprod7.jpeg"
import image9 from "../images/catalogue/hmgoepprod8.jpeg"
import image10 from "../images/catalogue/hmgoepprod9.jpeg"

const images = [
    {
        image: { image1 }
    },
    {
        image: { image2 }
    }, {
        image: { image3 }
    }, {
        image: { image4 }
    }, {
        image: { image5 }
    }, {
        image: { image6 }
    }, {
        image: { image7 }
    }, {
        image: { image8 }
    }, {
        image: { image9 }
    }, {
        image: { image10 }
    },
]

const Catalogue = () => {
    return (
        <>
            <section className="mt-12 flex flex-col">

                <div className="text-5xl flex justify-center">
                    <hr />
                    <p className="mt-3">Check out all the clothes </p>
                </div>
                <div className="flex mt-150 overflow-x-hidden">
                    <img src="" alt="" />

                </div>

            </section>
        </>
    )
}

export default Catalogue
